  e.preventDefault();
  const {name,email,phone,profession,password,cpassword}=user;
  const res= await fetch("/register",{
   method: "POST",
   headers:{
    "Content-Type" : "application/json"
   },
   body: JSON.stringify({
    name,email,phone,profession,password,cpassword

   })
  });
  const data= await res.json();

